#include <stdio.h>
#include <stdlib.h>

void print_matrix(int width, int height, int** matrix);
void revert_rows_order(int height, int** matrix);

int main() {
   int width, height;
   printf("Enter width of matrix: ");
   scanf("%d", &width);

   printf("\nEnter height of matrix: ");
   scanf("%d", &height);

   int** matrix = malloc(height * sizeof *matrix);
   for (int i = 0; i < height; ++i) {
      int* row = malloc(width * sizeof *row);
      *(matrix + i) = row;
   }

   for (int i = 0; i < height; ++i) {
      for (int j = 0; j < width; ++j) {
         printf("\nEnter value at row %d, column %d: ", i + 1, j + 1);
         int value;
         scanf("%d", &value);
         *(*(matrix + i) + j) = value;
      }
   }

   printf("\nOriginal matrix:\n");
   print_matrix(width, height, matrix);

   revert_rows_order(height, matrix);

   printf("\nMatrix with rows reversed:\n");
   print_matrix(width, height, matrix);
}

void print_matrix(int width, int height, int** matrix) {
   for (int i = 0; i < height; ++i) {
      for (int j = 0; j < width; ++j) {
         printf("%d ", *(*(matrix + i) + j));
      }

      printf("\n");
   }
}

void revert_rows_order(int height, int** matrix) {
   int** head = matrix;
   int** tail = matrix + height - 1;

   while (head < tail) {
      int* tail_temp = *tail;
      *tail = *head;
      *head = tail_temp;

      ++head;
      --tail;
   }
}

